import React, { useState } from "react";
import { useSelector } from "react-redux";
import { Link } from "react-router-dom";
import {useSpring, animated} from "react-spring";
import store from "../../store/store";
import { motion } from "framer-motion";

function Navbar(param) {
  let hover = useSelector(state => state.hover);
  const props = useSpring({
    backgroundColor: "#000"
  });

  function mouseEnter(){
    store.dispatch({type: "hover"});
  }

  function mouseLeave(){
    store.dispatch({type: "not"});
  }

  // let name_class="navbar"+ param.class; 
  const navVariants = {
    initial: {translateY: "-100%", opacity: 0},
    enter: {translateY: "0%",opacity: 1, transition: {
        duration: 0.5,
        ease: [0.43, 0.13, 0.23, 0.96]
      }},
    exit: {translateY: "-100%", opacity: 0, transition: {
      duration: 0.5,
      ease: [0.43, 0.13, 0.23, 0.96]
    }}
}

  return (
    <motion.nav variants = {navVariants} initial="initial" animate="enter" exit="exit" className="navbar" id="navbar">
      <div className="container-fluid mx-5 pt-2 pb-2">
        <ul className="navbar-nav">
          <li className = "nav-item">
            <Link to="/about" id="about" className="nav-link">
              about
            </Link>
          </li>
        
          <Link to="/" class="navbar-brand">amor</Link>
        
          <li className = "nav-item">
            <Link to="/login" id="dishes" className="nav-link">
              login
            </Link>
          </li>
          
        </ul>
      </div>  
    </motion.nav>
  )
}

export default Navbar;
